import {GET_USERS} from '../constants/action-types';

function getUser() {
	return function(dispatch){
		return fetch('https://ti-react-test.herokuapp.com/users')
				.then(res =>res.json())
				.then(json => {
					dispatch({type:GET_USERS,payload:json});
				})
	}
//   return { type: "GET_USERS", payload:[{"id":30,"name":"The UnderTaker",
